« …Mandehana, misehoa amin’ny mpisorona. Ary rehefa lasa izy ireo, dia nadio teny ampandehanana. Ary ny anankiray tamin’ireo, raha nahita fa sitrana izy, dia niverina ka nankalaza an’Andriamanitra tamin’ny feo mahery, sady niankohoka tamin’ny tongotr’i Jesosy ka nisaotra Azy… » Lioka 17: 14-16 Nisy mararin’ny habokana folo lahy nifanena tamin’i Jesosy, ary niantso mafy Azy ny mba hamindràny fo. Tsy nandositra azy ireo Jesosy fa namaly Azy: Mandehana miseho any amin’ny mpisorona. Ny boka dia toko
..........
, fa mbola nasainy nandeha ho any amin’ny mpisorona izy aloha. Nino an’i Jesosy ireto marary ireto, satria nihaino ny Teniny izy ireo ka lasa nandeha hiseho any amin’ny mpisorona: Ny valin’izany finoana an’i Jesosy izany: Sitrana, nadio teny ampandehanana izy folo lahy. – Ny mampalahelo anefa rehefa sitrana ireo dia iray tamin’izy folo lahy ihany no nahatsiaro nankalaza an’Andriamanitra ka niverina niankohoka teo amin’i Jesosy. Ity iray ity ihany no voavonjy! Jesosy Kristy Tompo mampahery anao;

Ny 19 Jolay 2011, ny Filoham-pirenen'i Panamà, Ricardo Martinelli, dia nahatezitra ny Twitter. Toy ny mahazatra, nanomboka nibitsika momba ny tanjon'ny governemantany ny filoha (@rmartinelli) ary naneso ny mpanohitra. Nanomboka nanakiana [es] fanambarana iray nivoaka tamin'ny gazety mpivoaka isan'andro La Prensa izy, izay nanambara ny trosan'i Panamà (37%) raha oharina amin'ny an'i Etazonia (84%). Sin argumentos, politicos neofitos y el diario del N0 a todo,no dicen que la relacion deuda pib es 
..........
] : @la_cascara respeta hambriento perredista. #RespetaHP Nandritra ny fotoana maromaro, maro no naminavina fa hoe nisy nisandoka ny kaont Twitter-n'ny filoha, nefa tsy nisy na dia iray aza avy ao amin'ny Fitondrana nanamarina izany. Ny marina dia nofafàna ilay bitsika ary nibitsika [es] ny Filoha avy eo niampanga ny olona ho avy hatrany dia manao tsoa-kevitra maimaika, raha naka ho ohatra an'ilay mpamosavy malaza, Harry Potter fotsiny no nataony : Para todos los mal pensados hp es Harry Potter.
